const TestPage = () => {
  const [responses, setResponses] = useState<ApiResponse<string>>({
    status: 0,
    message: "",
  })

  const getApiResponse = async () => {
    const response = await importAllUsers()
    const result = response as { status: number; message: string }

    setResponses(result)
  }

  const handleClick = async () => {
    const result = await writePerformersFromImport(dummyData)

    if (result.status) {
      console.log(result.data)
    } else {
      console.log(result.data)
    }
  }

  const handleClickFromApiMap = async () => {
    const performers: PerformerDto[] = JSON.parse(dummyData) as PerformerDto[]
    const performerFromDto = createPerformerFromDto(performers[0])

    try {
      const response = await fetch("/api/users/createUser", {
        method: "put",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify(performerFromDto),
      })

      console.log(response)
    } catch (error) {
      // Do something here.
    }
  }

  const handleClickUserExists = async () => {
    try {
      const response = await fetch("/api/users/getUserById/blah", {
        method: "get",
      })

      const data = await response.json()
      const isSuccess = data.success

      console.log(isSuccess)
    } catch (error) {
      // Do something here.
    }
  }

  useEffect(() => {
    void getApiResponse()
  }, [])

  return (
    <main>
      <div>
        The API GET request finished with status code {responses.status}. The
        message is "{responses.message}"
      </div>
      <button onClick={handleClickFromApiMap}>Click to import data</button>
      <button onClick={handleClickUserExists}>
        Click to see if user exists
      </button>
    </main>
  )
}

export default TestPage
